<body lang="pt-BR" dir="ltr">
<p align="center" style="margin-bottom: 0.35cm; line-height: 115%"><a name="_GoBack"></a>
<font size="4" style="font-size: 14pt"><b>GERANDO LOGIN DE LÍDER DE
CÉLULA E DE MEMBRO</b></font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Nosso
sistema tem uma área dedicada apenas a células, mas é claro que
seria muito difícil se apenas um usuário tivesse que atualizar as
informações sobre todas as células e seus participantes sozinho,
não é? Pensando nisso, nós criamos uma área para que os próprios
membros possam atualizar seus dados pessoais, acompanhar os encontros
da célula e até confirmar sua presença no encontro, além de
poderem visualizar novidades sobre a igreja.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
1:</b></font><font size="4" style="font-size: 14pt"> Para que cada
membro tenha acesso a sua própria página, você precisará realizar
um pré-cadastro, mas é bem rápido e fácil. Primeiro, clique em
“Segurança” no menu lateral e acesse “Grupos de Usuário”.
Nós precisaremos criar dois novos grupos, de preferência com os
nomes “Membros” e “Líderes de Célula”.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 5" align="bottom" width="1285" height="608" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
2:</b></font><font size="4" style="font-size: 14pt"> Após criados os
Grupos de Usuário, acesse “Grupos/Permissões” em “Segurança”
no menu lateral e clique em “Novo Registro”. Selecione o grupo
“Membros” e defina como </font><font color="#00b050"><font size="4" style="font-size: 14pt"><b>SIM</b></font></font><font size="4" style="font-size: 14pt">
todas as permissões do módulo “Área do Membro”, como abaixo.
Cuidado para não dar outras permissões para este grupo!</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 11" align="bottom" width="1285" height="608" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">Após
salvar, clique novamente em “Novo Registro”. Dessa vez selecione
o grupo “Líderes de Célula” e defina como </font><font color="#00b050"><font size="4" style="font-size: 14pt"><b>SIM</b></font></font><font size="4" style="font-size: 14pt">
a permissão </font><font size="4" style="font-size: 14pt"><u>Alteração
Perfil Usuário</u></font><font size="4" style="font-size: 14pt"> do
módulo “Área do Membro”...</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 7" align="bottom" width="1285" height="603" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt">...
e também as permissões </font><font size="4" style="font-size: 14pt"><u>Gerenciar
Encontro</u></font><font size="4" style="font-size: 14pt"> e
</font><font size="4" style="font-size: 14pt"><u>Participantes</u></font><font size="4" style="font-size: 14pt">
no módulo “Gestão de Células”. Quaisquer outras permissões
que queiram ser dadas ao líder de célula poderão ser definidas a
critério da igreja.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 16" align="bottom" width="1285" height="603" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
3:</b></font><font size="4" style="font-size: 14pt"> Ok, após gravar
as permissões, você precisará cadastrar todos os líderes das
células como usuários do sistema. Para isso, clique em “Usuários”
no menu “Segurança” e registre os líderes um por um. Lembre-se
de selecionar o grupo “Líderes de Célula” para todos.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 10" align="bottom" width="1285" height="603" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
4:</b></font><font size="4" style="font-size: 14pt"> Agora vamos
criar o login dos outros membros! Clique em “Segurança” no menu
lateral e acesse “Criar Login Para Membros”.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 4" align="bottom" width="1285" height="608" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Passo
5:</b></font><font size="4" style="font-size: 14pt"> Na tela
seguinte, clique em “Gerar Login Membros” e você será
direcionado para a página abaixo. Na primeira lacuna, escolha o
grupo “Membros”. A partir daqui você terá que escolher para
quem criará o login (</font><font size="4" style="font-size: 14pt"><u>Todos
os Membros</u></font><font size="4" style="font-size: 14pt"> ou
</font><font size="4" style="font-size: 14pt"><u>Pessoa Específica</u></font><font size="4" style="font-size: 14pt">)
e qual será a senha gerada (senha automática do sistema ou </font><font size="4" style="font-size: 14pt"><u>Senha
Específica</u></font><font size="4" style="font-size: 14pt">). Nesta
tela você tem a opção de enviar e-mails automáticos aos membros
informando sua inclusão no sistema e seus respectivos dados de
acesso.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><img src="data:image/png;base64," name="Imagem 14" align="bottom" width="1285" height="604" border="0"></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><u><b>OBS.:</b></u></font><font size="4" style="font-size: 14pt">
Para que o sistema gere um login, o membro precisa ter um e-mail em
seu cadastro e pelo menos um dos campos “CPF” ou “Data de
Nascimento” preenchidos. Em caso contrário, você será avisado.
Caso o problema seja com a senha automática por falta de informações
no cadastro do membro, opte por um </font><font size="4" style="font-size: 14pt"><u>Senha
Específica</u></font><font size="4" style="font-size: 14pt">.</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><font size="4" style="font-size: 14pt"><b>Pronto!</b></font><font size="4" style="font-size: 14pt">
Após gerar os logins, os líderes e os membros poderão ter acesso
às suas próprias páginas e elas serão parecidas com as imagens
abaixo!</font></p>
<p style="margin-bottom: 0.35cm; line-height: 115%"><br><br>
</p>
